import 'package:hlshop/all_file/all_file.dart';part 'rating_reply_model.g.dart';@JsonSerializable()class RatingReplyModel {  @JsonKey(name: 'itemid')  final String? itemId;  @JsonKey(name: 'ctime')  final String? createdTime;  @JsonKey(name: 'userid')  final String? userId;  final String? comment;  const RatingReplyModel({    this.itemId,    this.createdTime,    this.userId,    this.comment,  });  factory RatingReplyModel.fromJson(Map<String, dynamic> json) =>      _$RatingReplyModelFromJson(json);  Map<String, dynamic> toJson() => _$RatingReplyModelToJson(this);}extension RatingReplyModelConverter on RatingReplyModel {  RatingReplyEntity toEntity() {    return RatingReplyEntity(      id: itemId,      createdTime: createdTime,      userId: userId,      comment: comment,    );  }}